ling_api_callback_request.log','Log file to store the CallBack API requests.',0,NULL,'log-files'),(145,'Webservice Card Log File','api_card','/var/log/a2billing/a2billing_api_card.log','Log file to store the Card Webservice Logs',0,NULL,'log-files'),(146,'AGI Log File','agi','/var/log/a2billing/a2billing_agi.log','File to log.',0,NULL,'log-files'),(147,'Description','description','VentaDetalle','Description/notes field',0,NULL,'agi-conf1'),(148,'Asterisk Version','asterisk_version','1_18','Asterisk Version Information, 1_1, 1_2, 1_4, 1_6, 1_8 1_10 1_11',0,NULL,'agi-conf1'),(149,'Answer Call','answer_call','0','Manage the answer on the call. Disabling this for callback trigger numbers makes it ring not hang up.',1,'yes,no','agi-conf1'),(150,'Play Audio','play_audio','0','Play audio - this will disable all stream file but not the Get Data , for wholesale ensure that the authentication works and than number_try = 1.',1,'yes,no','agi-conf1'),(151,'Say GoodBye','say_goodbye','0','play the goodbye message when the user has finished.',1,'yes,no','agi-conf1'),(152,'Play Language Menu','play_menulanguage','0','enable the menu to choose the language, press 1 for English, pulsa 2 para el espaol, Pressez 3 pour Franais',1,'yes,no','agi-conf1'),(153,'Force Language','force_language','','force the use of a language, if you dont want to use it leave the option empty, Values : ES, EN, FR, etc... (according to the audio you have installed).',0,NULL,'agi-conf1'),(154,'Intro Prompt','intro_prompt','','Introduction prompt : to specify an additional prompt to play at the beginning of the application .',0,NULL,'agi-conf1'),(155,'Min Call Credit','min_credit_2call','0.5','Minimum amount of credit to use the application .',0,NULL,'agi-conf1'),(156,'Min Bill Duration','min_duration_2bill','0','this is the minimum duration in seconds of a call in order to be billed any call with a length less than min_duration_2bill will have a 0 cost useful not to charge callers for system errors when a call was answered but it actually didn\'t connect.',0,NULL,'agi-conf1'),(157,'Not Enough Credit','notenoughcredit_cardnumber','0','if user doesn\'t have enough credit to call a destination, prompt him to enter another cardnumber .',1,'yes,no','agi-conf1'),(158,'New Caller ID','notenoughcredit_assign_newcardnumber_cid','0','if notenoughcredit_cardnumber = YES  then	assign the CallerID to the new cardnumber.',1,'yes,no','agi-conf1'),(159,'Use DNID','use_dnid','1','if YES it will use the DNID and try to dial out, without asking for the phonenumber to call.',1,'yes,no','agi-conf1'),(160,'Not Use DNID','no_auth_dnid','','list the dnid on which you want to avoid the use of the previous option \"use_dnid\" .',0,NULL,'agi-conf1'),(161,'Try Count','number_try','1','number of times the user can dial different number.',0,NULL,'agi-conf1'),(162,'Force CallPlan','force_callplan_id','','this will force to select a specific call plan by the Rate Engine.',0,NULL,'agi-conf1'),(163,'Say Balance After Auth','say_balance_after_auth','0','Play the balance to the user after the authentication (values : yes - no).',1,'yes,no','agi-conf1'),(164,'Say Balance After Call','say_balance_after_call','0','Play the balance to the user after the call (values : yes - no).',1,'yes,no','agi-conf1'),(165,'Say Rate','say_rateinitial','0','Play the initial cost of the route (values : yes - no)',1,'yes,no','agi-conf1'),(166,'Say Duration','say_timetocall','0','Play the amount of time that the user can call (values : yes - no).',1,'yes,no','agi-conf1'),(167,'Auto Set CLID','auto_setcallerid','1','enable the setup of the callerID number before the outbound is made, by default the user callerID value will be use.',1,'yes,no','agi-conf1'),(168,'Force CLID','force_callerid','','If auto_setcallerid is enabled, the value of force_callerid will be set as CallerID.',0,NULL,'agi-conf1'),(169,'CLID Sanitize','cid_sanitize','CID','If force_callerid is not set, then the following option ensures that CID is set to one of the card\'s configured caller IDs or blank if none available.(NO - disable this feature, caller ID can be anything, CID - Caller ID must be one of the customers caller IDs, DID - Caller ID must be one of the customers DID nos, BOTH - Caller ID must be one of the above two items)',0,NULL,'agi-conf1'),(170,'CLID Enable','cid_enable','0','enable the callerid authentication if this option is active the CC system will check the CID of caller  .',1,'yes,no','agi-conf1'),(171,'Ask PIN','cid_askpincode_ifnot_callerid','0','if the CID does not exist, then the caller will be prompt to enter his cardnumber .',1,'yes,no','agi-conf1'),(172,'FailOver LCR/LCD Prefix','failover_lc_prefix','0','if we will failover for LCR/LCD prefix. For instance if you have 346 and 34 for if 346 fail it will try to outbound with 34 route.',1,'yes,no','agi-conf1'),(173,'Auto CLID','cid_auto_assign_card_to_cid','0','if the callerID authentication is enable and the authentication fails then the user will be prompt to enter his cardnumber;this option will bound the cardnumber entered to the current callerID so that next call will be directly authenticate.',1,'yes,no','agi-conf1'),(180,'Auto CLID Security','callerid_authentication_over_cardnumber','0','to check callerID over the cardnumber authentication (to guard against spoofing).',1,'yes,no','agi-conf1'),(181,'SIP Call','sip_iax_friends','0','enable the option to call sip/iax friend for free (values : YES - NO).',1,'yes,no','agi-conf1'),(182,'SIP Call Prefix','sip_iax_pstn_direct_call_prefix','555','if SIP_IAX_FRIENDS is active, you can define a prefix for the dialed digits to call a pstn number .',0,NULL,'agi-conf1'),(183,'Direct Call','sip_iax_pstn_direct_call','0','this will enable a prompt to enter your destination number. if number start by sip_iax_pstn_direct_call_prefix we do directly a sip iax call, if not we do a normal call.',1,'yes,no','agi-conf1'),(184,'IVR Voucher Refill','ivr_voucher','0','enable the option to refill card with voucher in IVR (values : YES - NO) .',1,'yes,no','agi-conf1'),(185,'IVR Voucher Prefix','ivr_voucher_prefix','8','if ivr_voucher is active, you can define a prefix for the voucher number to refill your card, values : number - don\'t forget to change prepaid-refill_card_with_voucher audio accordingly .',0,NULL,'agi-conf1'),(186,'IVR Low Credit','jump_voucher_if_min_credit','0','When the user credit are below the minimum credit to call min_credit jump directly to the voucher IVR menu  (values: YES - NO) .',1,'yes,no','agi-conf1'),(187,'Dial Command Params','dialcommand_param',',60,rL(%timeout%:61000:30000)','More information about the Dial : http://voip-info.org/wiki-Asterisk+cmd+dial<br>30 :  The timeout parameter is optional. If not specifed, the Dial command will wait indefinitely, exiting only when the originating channel hangs up, or all the dialed channels return a busy or error condition. Otherwise it specifies a maximum time, in seconds, that the Dial command is to wait for a channel to answer.<br>H: Allow the caller to hang up by dialing * <br>r: Generate a ringing tone for the calling part',0,NULL,'agi-conf1'),(188,'SIP/IAX Dial Command Params','dialcommand_param_sipiax_friend',',60,rL(3600000:61000:30000)','by default (3600000  =  1HOUR MAX CALL).',0,NULL,'agi-conf1'),(189,'Outbound Call','switchdialcommand','0','Define the order to make the outbound call<br>YES -> SIP/dialedphonenumber@gateway_ip - NO  SIP/gateway_ip/dialedphonenumber<br>Both should work exactly the same but i experimented one case when gateway was supporting dialedphonenumber@gateway_ip, So in case of trouble, try it out.',1,'yes,no','agi-conf1'),(190,'Failover Retry Limit','failover_recursive_limit','1','failover recursive search - define how many time we want to authorize the research of the failover trunk when a call fails (value : 0 - 20) .',0,NULL,'agi-conf1'),(191,'Max Time','maxtime_tocall_negatif_free_route','3600','This setting specifies an upper limit for the duration of a call to a destination for which the selling rate is less than or equal to 0.',0,NULL,'agi-conf1'),(192,'Send Reminder','send_reminder','0','Send a reminder email to the user when they are under min_credit_2call.',1,'yes,no','agi-conf1'),(193,'Record Call','record_call','0','enable to monitor the call (to record all the conversations) value : YES - NO .',1,'yes,no','agi-conf1'),(194,'Monitor File Format','monitor_formatfile','gsm','format of the recorded monitor file.',0,NULL,'agi-conf1'),(195,'AGI Force Currency','agi_force_currency','','Force to play the balance to the caller in a predefined currency, to use the currency set for by the customer leave this field empty.',0,NULL,'agi-conf1'),(196,'Currency Associated','currency_association','usd:dollars,mxn:pesos,eur:euros,cop:pesos,all:credit','Define all the audio (without file extensions) that you want to play according to currency (use , to separate, ie \"usd:prepaid-dollar,mxn:pesos,eur:Euro,all:credit\").',0,NULL,'agi-conf1'),(259,'Option Local Dialing','local_dialing_addcountryprefix','0','Add the countryprefix of the user in front of the dialed number if this one have only 1 leading zero',1,'yes,no','agi-conf1'),(261,'Max time to Call a DID no billed','max_call_call_2_did','3600','max time to call a did of the system and not billed . this max value is in seconde and by default (3600 = 1HOUR MAX CALL).',0,NULL,'agi-conf1'),(198,'File Enter Destination','file_conf_enter_destination','prepaid-enter-dest','Please enter the file name you want to play when we prompt the calling party to enter the destination number, file_conf_enter_destination = prepaid-enter-number-u-calling-1-or-011.',0,NULL,'agi-conf1'),(219,'Menu Language Order','conf_order_menulang','es:en:fr','Enter the list of languages authorized for the menu.Use the code language separate by a colon charactere e.g: en:es:fr',0,NULL,'agi-conf1'),(200,'Bill Callback','callback_bill_1stleg_ifcall_notconnected','1','Define if you want to bill the 1st leg on callback even if 