INSERT INTO `cc_templatemail` VALUES (1,'en','signup','noreply@miempresa.com','Mi Empresa','Confirmacin de registro','Gracias por registrarse con nosotros.\r\n\r\nSiga el enlace para activar su cuenta:\r\n\r\nhttp://sip10.voztovoice.org/a2billing/customer/activate.php?key=$loginkey$\r\n\r\nUn Administrador revisar sus datos y activar su cuenta dentro de las prximas 24 horas\r\n\r\nSaludos\r\nMi Empresa',''),(2,'en','reminder','noreply@miempresa.com','COMPANY NAME','Your COMPANY NAME account $cardnumber$ is low on credit ($currency$ $c','Your COMPANY NAME Account number $cardnumber$ is running low on credit.\r\n\r\nThere is currently only $creditcurrency$ $currency$ left on your account which is lower than the warning level defined ($credit_notification$)\r\n\r\n\r\nPlease top up your account ASAP to ensure continued service\r\n\r\nIf you no longer wish to receive these notificationswould like to change the balance amount at which these warnings are generated,\r\nplease connect on your myaccount panel and change the appropriate parameters\r\n\r\n\r\nyour account information :\r\nYour account number for VOIP authentication : $cardnumber$\r\n\r\nhttp://myaccount.mydomainname.com/\r\nYour account login : $login$\r\nYour account password : $password$\r\n\r\n\r\nThanks,\r\n/COMPANY NAME Team\r\n-\r\nhttp://www.mydomainname.com',''),(3,'en','forgetpassword','noreply@miempresa.com','COMPANY NAME','Login Information','Your login information is as below:\r\n\r\nYour account is $cardnumber$\r\n\r\nYour password is $password$\r\n\r\nYour login is $login$\r\n\r\nhttp://mydomainname.com/A2BCustomer_UI/\r\n\r\nKind regards,\r\nYourDomain',''),(4,'en','signupconfirmed','noreply@miempresa.com','COMPANY NAME','SIGNUP CONFIRMATION','Thank you for registering with us\r\n\r\nPlease make sure you active your account by making payment to us either by\r\ncredit card, wire transfer, money order, cheque, and western  money\r\ntransfer, money Gram, and Pay pal.\r\n\r\nYour account is $cardnumber$\r\n\r\nYour password is $password$\r\n\r\nTo go to your account :\r\nhttp://mydomainname.com/customer/\r\n\r\nKind regards,\r\nYourDomain',''),(5,'en','epaymentverify','noreply@miempresa.com','COMPANY NAME','Epayment Gateway Security Verification Failed','Dear Administrator\r\n\r\nPlease check the Epayment Log, System has logged a Epayment Security failure. that may be a possible attack on epayment processing.\r\n\r\nTime of Transaction: $time$\r\nPayment Gateway: $paymentgateway$\r\nAmount: $itemAmount$\r\n\r\n\r\n\r\nKind regards,\r\nYourDomain',''),(6,'en','payment','noreply@miempresa.com','COMPANY NAME','PAYMENT CONFIRMATION','Thank you for shopping at COMPANY NAME.\r\n\r\nShopping details is as below.\r\n\r\nItem Name  $itemName$\r\nItem ID  $itemID$\r\nAmount  $itemAmount$\r\nPayment Method  $paymentMethod$\r\nStatus  $paymentStatus$\r\n\r\n\r\nKind regards,\r\nYourDomain',''),(13,'en','invoice_to_pay','noreply@miempresa.com','COMPANY NAME','Invoice to pay Ref: $invoice_reference$','New Invoice send with the reference : $invoice_reference$ .\r\n \r\n    Title : $invoice_title$ .\r\n Description : $invoice_description$\r\n \r\n    TOTAL (exclude VAT) : $invoice_total$  $base_currency$\r\n TOTAL (invclude VAT) : $invoice_total_vat$ $base_currency$ \r\n\r\n \r\n    TOTAL TO PAY : $invoice_total_vat$ $base_currency$\r\n\r\n \r\n    You can check and pay this invoice by your account on the web interface : http://mydomainname.com/customer/',NULL),(8,'en','did_paid','noreply@miempresa.com','COMPANY NAME','DID notification - ($did$)','BALANCE REMAINING $balance_remaining$ $base_currency$\r\n\r\nAn automatic taking away of : $did_cost$ $base_currency$ has been carry out of your account to pay your DID ($did$)\r\n\r\nMonthly cost for DID : $did_cost$ $base_currency$',NULL),(9,'en','did_unpaid','noreply@miempresa.com','COMPANY NAME','DID notification - ($did$)','BALANCE REMAINING $balance_remaining$ $base_currency$\r\n\r\nYour credit is not enough to pay your DID number ($did$), the monthly cost is : $did_cost$ $base_currency$\r\n\r\nYou have $days_remaining$ days to pay the invoice (REF: $invoice_ref$ )the DID will be automatically released',NULL),(10,'en','did_released','noreply@miempresa.com','COMPANY NAME','DID released - ($did$)','The DID $did$ has been automatically released!',NULL),(11,'en','new_ticket','noreply@miempresa.com','COMPANY NAME','Support Ticket #$ticket_id$','New Ticket Open (#$ticket_id$) From $ticket_owner$.\r\n Title : $ticket_title$\r\n Priority : $ticket_priority$ \r\n Status : $ticket_status$ \r\n Description : $ticket_description$',NULL),(12,'en','modify_ticket','noreply@miempresa.com','COMPANY NAME','Support Ticket #$ticket_id$','Ticket modified (#$ticket_id$) By $comment_creator$.\r\n Ticket Status -> $ticket_status$\r\n Description : $comment_description$',NULL),(14,'en','subscription_paid','noreply@miempresa.com','COMPANY NAME','Subscription notification - $subscription_label$ ($subscription_id$)','BALANCE  $credit$ $base_currency$\r\n\r\n\r\nA decrement of: $subscription_fee$ $base_currency$ has removed from your account to pay your service. ($subscription_label$)\r\n\r\n\r\nthe monthly cost is : $subscription_fee$',NULL),(15,'en','subscription_unpaid','noreply@miempresa.com','COMPANY NAME','Subscription notification - $subscription_label$ ($subscription_id$)','BALANCE $credit$ $base_currency$\r\n\r\n\r\nYou do not have enough credit to pay your subscription,($subscription_label$), the monthly cost is : $subscription_fee$ $base_currency$\r\n\r\n\r\nYou have $days_remaining$ days to pay the invoice (REF: $invoice_ref$ )your service may cease',NULL),(16,'en','subscription_disable_card','noreply@miempresa.com','COMPANY NAME','Service deactivated - unpaid service $subscription_label$ ($subscription_id$)','The account has been automatically deactivated until the invoice is settled.',NULL);
